import React, {Component} from 'react'
import { JsonToTable } from "react-json-to-table";

class DisplayTable extends Component {
  constructor(props) {
    super(props)
    this.state = {test : 5}
  }
  
  


  render() {
    if (JSON.parse(sessionStorage.getItem('sectionInfo'))) {
      this.setState({test: JSON.parse(sessionStorage.getItem('sectionInfo'))})
    }
    return (
      <div>
        <JsonToTable json = {this.state} />
      </div>
    )
  }
}
    
export default DisplayTable
